    return (
      <html dir="rtl">
        <Head>
          <title>Site Title</title>
          {/* <link href="/static/stylesheets/styles.css" rel="stylesheet" /> */}
          {/* <link href="/static/stylesheets/prism.css" rel="stylesheet" /> */}
        </Head>
        <body>
          <Main />
          <NextScript />
          {/* <script src="/static/scripts/prism.js"></script> */}
        </body>
      </html>
    );
  }
}
